import React, { useEffect } from 'react'
import { useSelector } from 'react-redux'
import { useDispatch } from 'react-redux'
import { useParams } from 'react-router-dom'
import { getAllProductsByCategory } from '../../requests/products_by_category_req'
import ProductsByCategoryContainer from '../../components/ProductsByCategoryContainer/ProductsByCategoryContainer'


export default function SingleCategoriesPage() {

const { id } = useParams()

const dispatch = useDispatch()

useEffect(() => dispatch(getAllProductsByCategory(id)), [])

   const products_by_category_store = useSelector(state => state.categories.date)

  return (
    <div>
      <ProductsByCategoryContainer products={products_by_category_store}/>
    </div>
  )
}
